package city.model.dao.entidades.extras;

public class GenericClassBoolean {

	private String gen_genero;

	private String gen_valors;

	private boolean gen_valor;

	private Integer gen_cantidad;

	public GenericClassBoolean() {
		// TODO Auto-generated constructor stub
	}

	public String getGen_genero() {
		return gen_genero;
	}

	public void setGen_genero(String gen_genero) {
		this.gen_genero = gen_genero;
	}

	public String getGen_valors() {
		return gen_valors;
	}

	public void setGen_valors(String gen_valors) {
		this.gen_valors = gen_valors;
	}

	public boolean isGen_valor() {
		return gen_valor;
	}

	public void setGen_valor(boolean gen_valor) {
		this.gen_valor = gen_valor;
	}

	public Integer getGen_cantidad() {
		return gen_cantidad;
	}

	public void setGen_cantidad(Integer gen_cantidad) {
		this.gen_cantidad = gen_cantidad;
	}

}
